const data = ''

let initialString = data
let done = false

function isLowerCase(str) {
  return str == str.toLowerCase() && str != str.toUpperCase();
}

function checkForMatches(string, startIndex) {
  for(let i = startIndex; i < string.length-1; i++) {
    const firstLower = isLowerCase(string[i])
    const secondLower = isLowerCase(string[i+1])

    if ((firstLower && !secondLower) || (!firstLower && secondLower)) {
      if (string[i].toLowerCase() === string[i+1].toLowerCase()) {
        newString = string.slice(0, i) + string.slice(i+1);
        checkForMatches(newString, i > 0 ? i-1 : 0)
        break;
      }
    }
  }
  return newString
}

const finalString = checkForMatches(initialString, 0)

console.log(finalString, finalString.length)
